import React from "react";
function StickyBlockBox(props) {
  const { list } = props;
  return (
    <div>
      {list.map((item, index) => (
        <div className="item">
          <ul>
            {item.type === "H1" && <li className="font-h1">{item.name}</li>}
            {item.type === "H2" && <li className="font-h2">{item.name}</li>}
          </ul>
        </div>
      ))}
    </div>
  );
}
export default StickyBlockBox;
